class Solution:
    def plusOne(digits):

        digits[-1] += 1

        i = digits.index(digits[-1])

        while digits[i] > 9:
            digits[i] = 0

            if i != 0:
                digits[i-1] += 1
            else:
                digits.insert(0, 1)

            i -= 1

        return digits
